import React, {useEffect, useState} from 'react'
import Home from "./Home";
import './App.css';
import Navigation from './Navigation';
import axios from 'axios';
import Moment from 'moment';
import {Link} from "react-router-dom"


const NewService = () => {

    return (
        <div>
    <h2>Add Service</h2>

    <form  onSubmit ={clickSubmit} className='row g-3 mt-3'>
        <div className='form-group col-md-6'>
            <label htmlFor="firstName" className="form-label">Service Name</label>
            <input type="text" onChange={handleChange} name="name" value={values.name}  className='form-control' id="firstName" required></input>
        </div>
        <div className='form-group col-md-6'>
            <label htmlFor="lastName" className="form-label">Price</label>
            <input type="text" onChange={handleChange} name='lastName' value={values.lastName} className='form-control' id="lasttName" required></input>
        </div>
 <div className='col-4'>
                 <button  type= "submit" className='btn btn-lg btn-success mt-5'>New Service</button>
                </div>

    </form>
    </div>
    )
}
